    Description: '                   The Sorenson Legacy Foundation Presents\r\n                          A Blast from the Past ‘60s Revue with the \r\nChoral Arts Society of Utah Chorale  and Special Guest Dan Jessop\r\n\r\n     The Choral Arts Society of Utah is taking a trip back to the sixties at Eisenhower Junior High School Auditorium, October 17, 2016, at 7:30 pm\\.  This unique Choral Concert under the baton of Music Director Sterling Poulson is sure to draw a crowd of High School Graduates from the late ‘50s to the early ‘70s as the choir performs music of the Beatles, The Beach Boys, The Association, Peter Paul & Mary, and Billy Joel\\!  One of Utah’s Premier Radio Personalities, Dan Jessop, will host the Choir’s ‘60s Revue\\.    Admission is free and no tickets are required\\. \r\n \r\n     Dan Jessop has the longest running, continuous career in Salt Lake\\-area radios hitting his 40th year in radio as operations director for KBZN \\(“The Breeze,” FM\\-97\\.9\\) and KLO \\(AM\\-1430\\)\\.  Dan has worked at stations including KVOG, KCPX, KUMT, KBLQ and “Magic 107\\.5\\.” He has also done talk radio and even did some TV weathercasting on KSTU/CH\\. 13\\. In October 2014, Dan joined the seven\\-station MID\\-UTAH/ELSINORE, UT cluster, which included Country KWUT \\(97\\.7 THE WOLF\\) and News KSVC\\- A/F\\.   Jessop currently works as the Program Director KOOL 98\\.9 & 102\\.3 Coyote Country at KOOL 98\\.9 in southern Utah and lives in St\\. George\\.\r\n \r\n     Now in its 30th year, the Choral Arts Society of Utah Master Chorale’s 100\\-voice mixed choir is based in Salt Lake City, and recently won the silver medal award at the Sing\\-n\\-Joy Choral Competition in Provo, Utah\\. Many of their performances are benefit concerts for schools and organizations providing humanitarian services to local areas\\. See a complete listing of the choir’s upcoming performances at www\\.casu\\.org or find them on Facebook and Twitter\\!\r\n\r\n            96   800x600         Normal   0               false   false   false      EN\\-US   JA   X\\-NONE                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                             / Style Definitions / table\\.MsoNormalTable  mso\\-style\\-name:"Table Normal";  mso\\-tstyle\\-rowband\\-size:0;  mso\\-tstyle\\-colband\\-size:0;  mso\\-style\\-noshow:yes;  mso\\-style\\-priority:99;  mso\\-style\\-parent:"";  mso\\-padding\\-alt:0in 5\\.4pt 0in 5\\.4pt;  mso\\-para\\-margin:0in;  mso\\-para\\-margin\\-bottom:\\.0001pt;  mso\\-pagination:widow\\-orphan;  font\\-size:10\\.0pt;  font\\-family:"Times New Roman";    \r\nThis concert is funded in part by a grant from the Salt Lake County Zoo Arts & Parks \\(ZAP\\)\r\n ',
