    Description: 'My early desire to become a museum-quality artist guides me with an unwavering faith. With all the negative, sometimes horrific events that happen in our world today, I am proud to have chosen to immerse myself in beauty and to share those experiences through my art. I am constantly setting a variety of mini goals that push me toward more artistic understanding, more growth. Through these explorations, I hope to provide tangible, visual reminders of the vast wealth of our natural world.\r\n\r\nThis show has an assortment of *plein air* (painting on location) and studio work that depicts my favorite, mountain places. In my first introduction to Alta, I felt as if I was experiencing the words in a song written by John Denver, “... coming home to a place I\'d never been before.” This was a new feeling, a new awareness to me. I listened to that feeling, trusted in it, and moved here to see where it would take me. I am so grateful that I did. Our mountains lift me up physically, emotionally, and spiritually. They truly make my heart soar.\r\n\r\nYes, you\'ll see a lot of paintings of Mount Superior. I believe that "her" beautiful face is what first triggered the artistic urge within. I love how "she" changes with the various seasons. Her beautiful winter veil can—in a moment—send snow avalanching down, piling up on the main road. As spring heats up, she sheds that white veil to reveal her butterfly. Such a lovely patch of snow. Down to her bare bones in the summer, she reigns gently, yet mightily over the multitude of wildflower carpets below. Fall finds her hunkered down in shadow as if to allow all attention to be directed at the golden aspen trees. I can never get enough of these fascinating changes.\r\n\r\nDevil\'s Castle has much the same effect upon me.\r\n\r\nFor 10 years I set my paints and hikes aside. My parents were aging and I knew that they would not always be there (except in my heart and mind). They were fun and easy to help. Now, I am back painting and experiencing this world. I hope that your experience of *High Places Make Me High* will quietly bring us a little closer together. Thanks so much for coming.',
