    Description: '**ARTIST STATEMENT**\r\n___\r\nThe purpose of this show is to take a look at Salt Lake City and its beautiful environs, from its gritty winter streets to its colorful spring surprises planted between mountain and valley.\r\n\r\n**\r\n___\r\n**\r\n\r\n**ARTIST BIOGRAPHY**\r\n\r\nTerence K. Stephens recently returned to his native Salt Lake City and opened a gallery, Art270, where he showcases local artists and performers. Prior to his return, he pursued artistic endeavors in San Francisco and Seattle. He received a B.F.A. from the University of Utah in Drawing and Painting and an associates degree at Utah Technical College (now Salt Lake Community College) in Graphic Design. He also studied in Avignon, France, and in Washington, D.C.\r\n\r\nTerence served on the board of The Center On Contemporary Art (C.O.C.A.) in Seattle and his works have shown at The Seattle Asian Art Museum. He has also been commissioned for several murals in Seattle and San Francisco in homes, businesses, and government facilities.\r\n\r\nMr. Stephens\' work includes figurative painting and sculpture, landscapes, florals, and portraits (including pets). His inspirations are travel and everyday experiences. His goal is to turn people on to art. He currently is on the board of The Salt Lake Acting Company.',
